    window.alert("print1 function")
  }
  function print2(){
    window.alert("print2 function")
  }
  function print3(){
    window.alert("print3 function")
  }
  function print4(){
    window.alert("print4 function")
  }

  return (
    <div className="App"> 
      {print1()}
      {print2()}
      {print3()}
      {print4()}
      <h2> {width} </h2>
    </div>
  )
}

export default App;
